import React,{Component} from "react";
import "../../scss/components/__sendnotification.scss";


const Checkbox = props => (
    <input type="checkbox" {...props} />
  )
class Send extends Component {
  
    render(){
      
        return(
          
                <div className="upload-wrapper">
                 
                  <div>
                     <input type="text"> Select User</input>
                     <input type="text"> Upload track</input>
                     <input type="text"> select cover art</input>
                     <input type="text"> UPC code</input>
                     <input type="text"> UPC code</input>
                  </div>
                </div>
        )
    }

};

export default Send;
